

CREATE TABLE `care_pharma_outside_order` (
  `id` int(15) NOT NULL AUTO_INCREMENT,
  `order_dt` varchar(35) DEFAULT NULL,
  `encounter_nr` varchar(12) NOT NULL,
  `gen_code` varchar(10) DEFAULT NULL,
  `drug_code` text,
  `brand_name` text,
  `price` decimal(10,2) NOT NULL DEFAULT '0.00',
  `quantity` int(15) DEFAULT NULL,
  `create_id` varchar(35) DEFAULT NULL,
  `create_dt` datetime DEFAULT NULL,
  `modify_id` varchar(35) DEFAULT NULL,
  `modify_dt` datetime DEFAULT NULL,
  `is_deleted` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `care_pharma_outside_order_encounter_nr` (`encounter_nr`),
  KEY `care_pharma_outside_order_gen_code` (`gen_code`),
  CONSTRAINT `care_pharma_outside_order_encounter_nr` FOREIGN KEY (`encounter_nr`) REFERENCES `care_encounter` (`encounter_nr`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



CREATE TABLE `seg_phil_medicine` (
