  `strength_code` VARCHAR(10) DEFAULT NULL,
  `unit_code` VARCHAR(10) DEFAULT NULL,
  `package_code` VARCHAR(10) DEFAULT NULL,
  PRIMARY KEY (`drug_code`)
) ENGINE=INNODB DEFAULT CHARSET=latin1;



